INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("春咲 ひより", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1, 2, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("草野 優衣", 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1, 2, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("士条 怜", 0, "フェンシングを始めてみては？", 0, 0, 1, 2, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 1003, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("穂高 みそぎ", 0, "ねぇ、にいちゃん！", 0, 0, 1, 2, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 1004, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("風宮 あかり", 0, "風宮あかりです", 0, 0, 1, 2, "ねぇ…", "私といっしょに…\nいかない？", 1006, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("出雲 宮子", 0, "出雲宮子なのー", 0, 0, 1, 2, "プリンたべたいのー", "食べ物の恨みは怖いのー", 1007, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("虹村 雪", 0, "ボクは虹村雪。", 0, 0, 1, 2, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 1008, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("柊杏奈", 0, "フッ…聞いて後悔するがいい！", 0, 0, 1, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 1009, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("姫宮 真歩", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 1010, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("衣之咲 璃乃", 0, "衣之咲璃乃です！", 0, 0, 1, 2, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 1011, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("柏崎 初音", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1, 2, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 1012, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("美波 鈴奈", 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1, 2, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("喜屋武 香織", 0, "はいたーい。\n喜屋武香織さー。", 0, 0, 1, 2, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 1017, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("支倉 伊緒", 0, "支倉伊緒です。", 0, 0, 1, 2, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", 1018, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("茜 ミミ", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1, 2, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 1020, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("栗林 くるみ", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1, 2, "あの……\nふぇ……", "ふぇぇぇぇぇん……", 1021, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("風宮 より", 0, "風宮よりです。\nあああああ！", 0, 0, 1, 2, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 1022, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("北条 綾音", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1, 2, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 1023, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("天野 すずめ", 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1, 2, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 1025, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("倉石 恵理子", 0, "……クスクス…私は\n…倉石恵理子……", 0, 0, 1, 2, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 1027, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("佐々木 咲恋", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 1028, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("桜井 望", 0, "桜井望だよ！\nよろしくねっ", 0, 0, 1, 2, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 1029, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ニノン・ジュベール", 0, "デケデケデンっ！", 0, 0, 1, 2, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 1030, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("上喜 しのぶ", 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1, 2, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", 1031, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("野戸まひる", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1, 2, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", 1033, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("綾瀬 ゆかり", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1, 2, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", 1034, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("氷川 鏡華", 0, "氷川鏡華…です", 0, 0, 1, 2, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", 1036, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("柏崎 栞", 0, "柏崎…栞です。", 0, 0, 1, 2, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("双葉 碧", 0, "ふ、双葉碧です。", 0, 0, 1, 2, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", 1040, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("三角 千歌", 0, "三角千歌です。", 0, 0, 1, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", 1042, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("安芸 真琴", 0, "安芸真琴だ。", 0, 0, 1, 2, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", 1043, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("イリヤ・オーンスタイン", 0, "わらわこそは夜を総べる者！", 0, 0, 1, 2, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("遠見 空花", 0, "そこで騎士は妖精を乱暴に……", 0, 0, 1, 2, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", 1045, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("宮坂たまき", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", 1046, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("大神 美冬", 0, "大神美冬よ！", 0, 0, 1, 2, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("星野静流", 0, "星野静流だよ！", 0, 0, 1, 2, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("玉泉美咲", 0, "アタシは玉泉美咲。", 0, 0, 1, 2, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("リマ", 0, "？？？", 0, 0, 1, 2, "？？？？", "？？？？", 1052, 1.4, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("モニカ・ヴァイスヴィント", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1053, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ペコリーヌ", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1058, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("コッコロ", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1059, 1.5, 0, 1, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("キャル", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1060, 1.5, 0, 1, 1, 0);
